import React from 'react';
import {Link, NavLink} from 'react-router-dom';
import {Button, Nav, Navbar, NavDropdown, Form, FormControl} from 'react-bootstrap';

const CustomNavbar = () => {
return(
// On small it collapses 

<Navbar bg="light" expand="sm">
    <Form inline>
      <FormControl type="search" placeholder="Enter Keyword .." className="mr-sm-4" />
    </Form>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#home" className="text-white">Home</Nav.Link>
      <Nav.Link href="#home" className="text-white">World</Nav.Link>
      <Nav.Link href="#link" className="text-white">Politics</Nav.Link>
      <Nav.Link href="#link" className="text-white">Business</Nav.Link>
      <Nav.Link href="#home" className="text-white">Technology</Nav.Link>
      <Nav.Link href="#link" className="text-white">Sports</Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
)}

export default CustomNavbar
